static int cp2112_gpio_direction_output(struct gpio_chip *chip,
					unsigned offset, int value)
{
	struct cp2112_device *dev = gpiochip_get_data(chip);
	struct hid_device *hdev = dev->hdev;
	u8 *buf = dev->in_out_buffer;
	unsigned long flags;
	int ret;
	spin_lock_irqsave(&dev->lock, flags);
	ret = hid_hw_raw_request(hdev, CP2112_GPIO_CONFIG, buf,
				 CP2112_GPIO_CONFIG_LENGTH, HID_FEATURE_REPORT,
				 HID_REQ_GET_REPORT);
	if (ret != CP2112_GPIO_CONFIG_LENGTH) {
		hid_err(hdev, "error requesting GPIO config: %d\n", ret);
		goto fail;
	}
	buf[1] |= 1 << offset;
	buf[2] = gpio_push_pull;
	ret = hid_hw_raw_request(hdev, CP2112_GPIO_CONFIG, buf,
				 CP2112_GPIO_CONFIG_LENGTH, HID_FEATURE_REPORT,
				 HID_REQ_SET_REPORT);
	if (ret < 0) {
		hid_err(hdev, "error setting GPIO config: %d\n", ret);
		goto fail;
	}
	spin_unlock_irqrestore(&dev->lock, flags);
	cp2112_gpio_set(chip, offset, value);
	return 0;
fail:
	spin_unlock_irqrestore(&dev->lock, flags);
	return ret < 0 ? ret : -EIO;
}

bool handleBackslash(signed char& out) {
  char ch = *p++;
  switch (ch) {
    case 0: return false;
    case '"': out = ch; return true;
    case '\\': out = ch; return true;
    case '/': out = ch; return true;
    case 'b': out = '\b'; return true;
    case 'f': out = '\f'; return true;
    case 'n': out = '\n'; return true;
    case 'r': out = '\r'; return true;
    case 't': out = '\t'; return true;
    case 'u': {
      if (UNLIKELY(is_tsimplejson)) {
        auto const ch1 = *p++;
        auto const ch2 = *p++;
        auto const dch3 = dehexchar(*p++);
        auto const dch4 = dehexchar(*p++);
        if (UNLIKELY(ch1 != '0' || ch2 != '0' || dch3 < 0 || dch4 < 0)) {
          return false;
        }
        out = (dch3 << 4) | dch4;
        return true;
      } else {
        uint16_t u16cp = 0;
        for (int i = 0; i < 4; i++) {
          auto const hexv = dehexchar(*p++);
          if (hexv < 0) return false; 
          u16cp <<= 4;
          u16cp |= hexv;
        }
        if (u16cp > 0x7f) {
          return false;
        } else {
          out = u16cp;
          return true;
        }
      }
    }
    default: return false;
  }
}

int nsim_bpf(struct net_device *dev, struct netdev_bpf *bpf)
{
	struct netdevsim *ns = netdev_priv(dev);
	int err;
	ASSERT_RTNL();
	switch (bpf->command) {
	case XDP_SETUP_PROG:
		err = nsim_setup_prog_checks(ns, bpf);
		if (err)
			return err;
		return nsim_xdp_set_prog(ns, bpf, &ns->xdp);
	case XDP_SETUP_PROG_HW:
		err = nsim_setup_prog_hw_checks(ns, bpf);
		if (err)
			return err;
		return nsim_xdp_set_prog(ns, bpf, &ns->xdp_hw);
	case BPF_OFFLOAD_MAP_ALLOC:
		if (!ns->bpf_map_accept)
			return -EOPNOTSUPP;
		return nsim_bpf_map_alloc(ns, bpf->offmap);
	case BPF_OFFLOAD_MAP_FREE:
		nsim_bpf_map_free(bpf->offmap);
		return 0;
	default:
		return -EINVAL;
	}
}

