snmp_ber_encode_unsigned_integer(unsigned char *out, uint32_t *out_len, uint8_t type, uint32_t number)
{
  uint32_t original_out_len;
  original_out_len = *out_len;
  do {
    (*out_len)++;
    *out-- = (uint8_t)(number & 0xFF);
    number >>= 8;
  } while(number);
  out = snmp_ber_encode_length(out, out_len, ((*out_len - original_out_len) & 0xFF));
  out = snmp_ber_encode_type(out, out_len, type);
  return out;
}

_SSL_match_hostname (const char *cert_hostname, const char *hostname)
{
	const char *cert_domain, *domain, *next_dot;
	if (g_ascii_strcasecmp (cert_hostname, hostname) == 0)
		return 0;
	if (cert_hostname[0] == '*')
	{
		cert_domain = &cert_hostname[1];
		if (cert_domain[0] == '\0')
			return -1;
		if (cert_domain[0] != '.')
			return -1;
		if (cert_domain[1] == '.')
			return -1;
		next_dot = strchr (&cert_domain[1], '.');
		if (next_dot == NULL)
			return -1;
		if (next_dot[1] == '.')
			return -1;
		domain = strchr (hostname, '.');
		if (domain == NULL || strlen(domain) == 1)
			return -1;
		if (g_ascii_strcasecmp (cert_domain, domain) == 0)
			return 0;
	}
	return -1;
}

