static int adpt_bios_param(struct scsi_device *sdev, struct block_device *dev,
		sector_t capacity, int geom[])
{
	int heads=-1;
	int sectors=-1;
	int cylinders=-1;
	if (capacity < 0x2000 ) {	
		heads = 18;
		sectors = 2;
	} 
	else if (capacity < 0x20000) {
		heads = 64;
		sectors = 32;
	}
	else if (capacity < 0x40000) {
		heads = 65;
		sectors = 63;
	}
	else if (capacity < 0x80000) {
		heads = 128;
		sectors = 63;
	}
	else {
		heads = 255;
		sectors = 63;
	}
	cylinders = sector_div(capacity, heads * sectors);
	if(sdev->type == 5) {  
		heads = 252;
		sectors = 63;
		cylinders = 1111;
	}
	geom[0] = heads;
	geom[1] = sectors;
	geom[2] = cylinders;
	PDEBUG("adpt_bios_param: exit\n");
	return 0;
}

