asmlinkage long sys_oabi_semtimedop(int semid,
				    struct oabi_sembuf __user *tsops,
				    unsigned nsops,
				    const struct timespec __user *timeout)
{
	struct sembuf *sops;
	struct timespec local_timeout;
	long err;
	int i;
	if (nsops < 1)
		return -EINVAL;
	sops = kmalloc(sizeof(*sops) * nsops, GFP_KERNEL);
	if (!sops)
		return -ENOMEM;
	err = 0;
	for (i = 0; i < nsops; i++) {
		__get_user_error(sops[i].sem_num, &tsops->sem_num, err);
		__get_user_error(sops[i].sem_op,  &tsops->sem_op,  err);
		__get_user_error(sops[i].sem_flg, &tsops->sem_flg, err);
		tsops++;
	}
	if (timeout) {
		err |= copy_from_user(&local_timeout, timeout, sizeof(*timeout));
		timeout = &local_timeout;
	}
	if (err) {
		err = -EFAULT;
	} else {
		mm_segment_t fs = get_fs();
		set_fs(KERNEL_DS);
		err = sys_semtimedop(semid, sops, nsops, timeout);
		set_fs(fs);
	}
	kfree(sops);
	return err;
}

int removeifnotchanged(const file_t *file, char **errorstring)
{
  int result;
  struct stat st;
  static char *filechanged = "File contents changed during processing";
  static char *unknownerror = "Unknown error";
  stat(file->d_name, &st);
  if (file->device != st.st_dev ||
      file->inode != st.st_ino ||
      file->ctime != st.st_ctime ||
      file->mtime != st.st_mtime ||
      file->size != st.st_size)
  {
    if (errorstring != 0)
        *errorstring = filechanged;
    return -2;
  }
  else
  {
    result = remove(file->d_name);
    if (result != 0 && errorstring != 0)
    {
      *errorstring = strerror(errno);
      if (*errorstring == 0)
        *errorstring = unknownerror;
    }
    return result;
  }
}

