static CACHE_BITMAP_V3_ORDER* update_read_cache_bitmap_v3_order(rdpUpdate* update, wStream* s,
                                                                UINT16 flags)
{
	BYTE bitsPerPixelId;
	BITMAP_DATA_EX* bitmapData;
	UINT32 new_len;
	BYTE* new_data;
	CACHE_BITMAP_V3_ORDER* cache_bitmap_v3;
	if (!update || !s)
		return NULL;
	cache_bitmap_v3 = calloc(1, sizeof(CACHE_BITMAP_V3_ORDER));
	if (!cache_bitmap_v3)
		goto fail;
	cache_bitmap_v3->cacheId = flags & 0x00000003;
	cache_bitmap_v3->flags = (flags & 0x0000FF80) >> 7;
	bitsPerPixelId = (flags & 0x00000078) >> 3;
	cache_bitmap_v3->bpp = CBR23_BPP[bitsPerPixelId];
	if (Stream_GetRemainingLength(s) < 21)
		goto fail;
	Stream_Read_UINT16(s, cache_bitmap_v3->cacheIndex); 
	Stream_Read_UINT32(s, cache_bitmap_v3->key1);       
	Stream_Read_UINT32(s, cache_bitmap_v3->key2);       
	bitmapData = &cache_bitmap_v3->bitmapData;
	Stream_Read_UINT8(s, bitmapData->bpp);
	if ((bitmapData->bpp < 1) || (bitmapData->bpp > 32))
	{
		WLog_Print(update->log, WLOG_ERROR, "invalid bpp value %" PRIu32 "", bitmapData->bpp);
		goto fail;
	}
	Stream_Seek_UINT8(s);                      
	Stream_Seek_UINT8(s);                      
	Stream_Read_UINT8(s, bitmapData->codecID); 
	Stream_Read_UINT16(s, bitmapData->width);  
	Stream_Read_UINT16(s, bitmapData->height); 
	Stream_Read_UINT32(s, new_len);            
	if (Stream_GetRemainingLength(s) < new_len)
		goto fail;
	new_data = (BYTE*)realloc(bitmapData->data, new_len);
	if (!new_data)
		goto fail;
	bitmapData->data = new_data;
	bitmapData->length = new_len;
	Stream_Read(s, bitmapData->data, bitmapData->length);
	return cache_bitmap_v3;
fail:
	free_cache_bitmap_v3_order(update->context, cache_bitmap_v3);
	return NULL;
}

Status CalculateOutputIndex(OpKernelContext* context, int dimension,
                            const vector<INDEX_TYPE>& parent_output_index,
                            INDEX_TYPE output_index_multiplier,
                            INDEX_TYPE output_size,
                            vector<INDEX_TYPE>* result) {
  const RowPartitionTensor row_partition_tensor =
      GetRowPartitionTensor(context, dimension);
  auto partition_type = GetRowPartitionTypeByDimension(dimension);
  switch (partition_type) {
    case RowPartitionType::VALUE_ROWIDS:
      CalculateOutputIndexValueRowID(
          context, row_partition_tensor, parent_output_index,
          output_index_multiplier, output_size, result);
      return tensorflow::Status::OK();
    case RowPartitionType::ROW_SPLITS:
      if (row_partition_tensor.size() - 1 > parent_output_index.size()) {
        return errors::InvalidArgument(
            "Row partition size is greater than output size: ",
            row_partition_tensor.size() - 1, " > ",
            parent_output_index.size());
      }
      CalculateOutputIndexRowSplit(
          context, row_partition_tensor, parent_output_index,
          output_index_multiplier, output_size, result);
      return tensorflow::Status::OK();
    default:
      return errors::InvalidArgument(
          "Unsupported partition type:",
          RowPartitionTypeToString(partition_type));
  }
}

real_need_secrets (NMVpnServicePlugin *plugin,
                   NMConnection *connection,
                   const char **out_setting_name,
                   GError **error)
{
	NMSettingVpn *s_vpn;
	NMSettingSecretFlags pw_flags;
	const char *pw = NULL;
	g_return_val_if_fail (NM_IS_VPN_SERVICE_PLUGIN (plugin), FALSE);
	g_return_val_if_fail (NM_IS_CONNECTION (connection), FALSE);
	s_vpn = nm_connection_get_setting_vpn (connection);
	if (!s_vpn) {
		g_set_error (error,
		             NM_VPN_PLUGIN_ERROR,
		             NM_VPN_PLUGIN_ERROR_INVALID_CONNECTION,
		             "%s",
		             _("Could not process the request because the VPN connection settings were invalid."));
		return FALSE;
	}
	pw = nm_setting_vpn_get_secret (s_vpn, NM_VPNC_KEY_SECRET);
	pw_flags = get_pw_flags (s_vpn, NM_VPNC_KEY_SECRET, NM_VPNC_KEY_SECRET_TYPE);
	if (!pw && !(pw_flags & NM_SETTING_SECRET_FLAG_NOT_REQUIRED)) {
		*out_setting_name = NM_SETTING_VPN_SETTING_NAME;
		return TRUE;
	}
	pw = nm_setting_vpn_get_secret (s_vpn, NM_VPNC_KEY_XAUTH_PASSWORD);
	pw_flags = get_pw_flags (s_vpn, NM_VPNC_KEY_XAUTH_PASSWORD, NM_VPNC_KEY_XAUTH_PASSWORD_TYPE);
	if (!pw && !(pw_flags & NM_SETTING_SECRET_FLAG_NOT_REQUIRED)) {
		*out_setting_name = NM_SETTING_VPN_SETTING_NAME;
		return TRUE;
	}
	return FALSE;
}

static int filter_frame(AVFilterLink *inlink, AVFrame *in)
{
    GradFunContext *s = inlink->dst->priv;
    AVFilterLink *outlink = inlink->dst->outputs[0];
    AVFrame *out;
    int p, direct;
    if (av_frame_is_writable(in)) {
        direct = 1;
        out = in;
    } else {
        direct = 0;
        out = ff_get_video_buffer(outlink, outlink->w, outlink->h);
        if (!out) {
            av_frame_free(&in);
            return AVERROR(ENOMEM);
        }
        av_frame_copy_props(out, in);
    }
    for (p = 0; p < 4 && in->data[p]; p++) {
        int w = inlink->w;
        int h = inlink->h;
        int r = s->radius;
        if (p) {
            w = s->chroma_w;
            h = s->chroma_h;
            r = s->chroma_r;
        }
        if (FFMIN(w, h) > 2 * r)
            filter(s, out->data[p], in->data[p], w, h, out->linesize[p], in->linesize[p], r);
        else if (out->data[p] != in->data[p])
            av_image_copy_plane(out->data[p], out->linesize[p], in->data[p], in->linesize[p], w, h);
    }
    if (!direct)
        av_frame_free(&in);
    return ff_filter_frame(outlink, out);
}

