gplotAddPlot(GPLOT       *gplot,
             NUMA        *nax,
             NUMA        *nay,
             l_int32      plotstyle,
             const char  *plottitle)
{
char       buf[L_BUF_SIZE];
char       emptystring[] = "";
char      *datastr, *title;
l_int32    n, i;
l_float32  valx, valy, startx, delx;
SARRAY    *sa;
    PROCNAME("gplotAddPlot");
    if (!gplot)
        return ERROR_INT("gplot not defined", procName, 1);
    if (!nay)
        return ERROR_INT("nay not defined", procName, 1);
    if (plotstyle < 0 || plotstyle >= NUM_GPLOT_STYLES)
        return ERROR_INT("invalid plotstyle", procName, 1);
    if ((n = numaGetCount(nay)) == 0)
        return ERROR_INT("no points to plot", procName, 1);
    if (nax && (n != numaGetCount(nax)))
        return ERROR_INT("nax and nay sizes differ", procName, 1);
    if (n == 1 && plotstyle == GPLOT_LINES) {
        L_INFO("only 1 pt; changing style to points\n", procName);
        plotstyle = GPLOT_POINTS;
    }
    numaGetParameters(nay, &startx, &delx);
    numaAddNumber(gplot->plotstyles, plotstyle);
    if (plottitle) {
        title = stringNew(plottitle);
        sarrayAddString(gplot->plottitles, title, L_INSERT);
    } else {
        sarrayAddString(gplot->plottitles, emptystring, L_COPY);
    }
    gplot->nplots++;
    snprintf(buf, L_BUF_SIZE, "%s.data.%d", gplot->rootname, gplot->nplots);
    sarrayAddString(gplot->datanames, buf, L_COPY);
    sa = sarrayCreate(n);
    for (i = 0; i < n; i++) {
        if (nax)
            numaGetFValue(nax, i, &valx);
        else
            valx = startx + i * delx;
        numaGetFValue(nay, i, &valy);
        snprintf(buf, L_BUF_SIZE, "%f %f\n", valx, valy);
        sarrayAddString(sa, buf, L_COPY);
    }
    datastr = sarrayToString(sa, 0);
    sarrayAddString(gplot->plotdata, datastr, L_INSERT);
    sarrayDestroy(&sa);
    return 0;
}

void Compute(OpKernelContext* ctx) override {
  const Tensor& in0 = ctx->input(0);
  const Tensor& in1 = ctx->input(1);
  ValidateInputTensors(ctx, in0, in1);
  if (!ctx->status().ok()) return;
  MatMulBCast bcast(in0.shape().dim_sizes(), in1.shape().dim_sizes());
  OP_REQUIRES(
      ctx, bcast.IsValid(),
      errors::InvalidArgument(
          "In[0] and In[1] must have compatible batch dimensions: ",
          in0.shape().DebugString(), " vs. ", in1.shape().DebugString()));
  TensorShape out_shape = bcast.output_batch_shape();
  auto batch_size = bcast.output_batch_size();
  auto d0 = in0.dim_size(in0.dims() - 2);  
  auto d1 = in0.dim_size(in0.dims() - 1);
  Tensor in0_reshaped;
  OP_REQUIRES(
      ctx,
      in0_reshaped.CopyFrom(in0, TensorShape({bcast.x_batch_size(), d0, d1})),
      errors::Internal("Failed to reshape In[0] from ",
                       in0.shape().DebugString()));
  auto d2 = in1.dim_size(in1.dims() - 2);
  auto d3 = in1.dim_size(in1.dims() - 1);
  Tensor in1_reshaped;
  OP_REQUIRES(
      ctx,
      in1_reshaped.CopyFrom(in1, TensorShape({bcast.y_batch_size(), d2, d3})),
      errors::Internal("Failed to reshape In[1] from ",
                       in1.shape().DebugString()));
  OP_REQUIRES(ctx, d1 == d2,
              errors::InvalidArgument(
                  "In[0] mismatch In[1] shape: ", d1, " vs. ", d2, ": ",
                  in0.shape().DebugString(), " ", in1.shape().DebugString(),
                  " ", lower_, " ", adjoint_));
  out_shape.AddDim(d1);
  out_shape.AddDim(d3);
  Tensor* out = nullptr;
  OP_REQUIRES_OK(ctx, ctx->allocate_output(0, out_shape, &out));
  if (out->NumElements() == 0) {
    return;
  }
  Tensor out_reshaped;
  OP_REQUIRES(ctx,
              out_reshaped.CopyFrom(*out, TensorShape({batch_size, d1, d3})),
              errors::Internal("Failed to reshape output from ",
                               out->shape().DebugString()));
  LaunchBatchBandedTriangularSolve<Scalar>::Launch(
      ctx, in0_reshaped, in1_reshaped, adjoint_, lower_, bcast,
      &out_reshaped);
}

