static void free_states(struct bpf_verifier_env *env)
{
	struct bpf_verifier_state_list *sl, *sln;
	int i;
	sl = env->free_list;
	while (sl) {
		sln = sl->next;
		free_verifier_state(&sl->state, false);
		kfree(sl);
		sl = sln;
	}
	env->free_list = NULL;
	if (!env->explored_states)
		return;
	for (i = 0; i < state_htab_size(env); i++) {
		sl = env->explored_states[i];
		while (sl) {
			sln = sl->next;
