		printk(KERN_WARNING"dpti: Could not copy buffer TO user\n");
		return -EFAULT;
	}
	return 0;
}

Jsi_RC Jsi_ValueInsertArray(Jsi_Interp *interp, Jsi_Value *target, int key, Jsi_Value *val, int flags)
{
    if (target->vt != JSI_VT_OBJECT) {
        if (interp->strict)
            Jsi_LogWarn("Target is not object");
        return JSI_ERROR;
    }
    Jsi_Obj *obj = target->d.obj;
    if (obj->isarrlist) {
        if (key >= 0 && key < interp->maxArrayList) {
            Jsi_ObjArraySet(interp, obj, val, key);
            return JSI_OK;
        }
        return JSI_ERROR;
    }
    char unibuf[100];
    Jsi_NumberItoA10(key, unibuf, sizeof(unibuf));
    Jsi_ObjInsert(interp, obj, unibuf, val, flags);
    return JSI_OK;
}

static int update_server_from_aliases(request_rec *r)
{
    const char *host = r->hostname;
    apr_port_t port;
    server_rec *s;
    server_rec *virthost_s;
    server_rec *last_s;
    name_chain *src;
    virthost_s = NULL;
    last_s = NULL;
    port = r->connection->local_addr->port;
    for (src = r->connection->vhost_lookup_data; src; src = src->next) {
        server_addr_rec *sar;
        sar = src->sar;
        if (sar->host_port != 0 && port != sar->host_port) {
            continue;
        }
        s = src->server;
        if (s != last_s) {
            if (matches_aliases(s, host)) {
                goto found;
            }
        }
        if (!strcasecmp(host, sar->virthost)) {
            if (virthost_s == NULL) {
                virthost_s = s;
            }
        }
        last_s = s;
    }
    if (virthost_s) {
        s = virthost_s;
        goto found;
    }
    if (!r->connection->vhost_lookup_data) { 
        if (matches_aliases(r->server, host)) {
            s = r->server;
            goto found;
        }
    }
    return HTTP_BAD_REQUEST;
found:
    r->server = s;
    return HTTP_OK;
}

