void resizeAndFillTable(
    HeaderTable& table, HPACKHeader& header, uint32_t newMax,
    uint32_t fillCount) {
  uint32_t newCapacity = header.bytes() * newMax;
  resizeTable(table, newCapacity, newMax);
  for (size_t i = 0; i <= fillCount; ++i) {
