static TEE_Result do_allocate_keypair(struct dsa_keypair *key, size_t l_bits,
				      size_t n_bits)
{
	DSA_TRACE("DSA allocate Keypair of L=%zu bits and N=%zu bits", l_bits,
		  n_bits);
	memset(key, 0, sizeof(*key));
	key->g = crypto_bignum_allocate(l_bits);
	if (!key->g)
		goto err;
	key->p = crypto_bignum_allocate(l_bits);
	if (!key->p)
		goto err;
	key->q = crypto_bignum_allocate(n_bits);
	if (!key->q)
		goto err;
	key->x = crypto_bignum_allocate(n_bits);
	if (!key->x)
		goto err;
	key->y = crypto_bignum_allocate(l_bits);
	if (!key->y)
		goto err;
	return TEE_SUCCESS;
err:
	DSA_TRACE("Allocation error");
	crypto_bignum_free(key->g);
	crypto_bignum_free(key->p);
	crypto_bignum_free(key->q);
	crypto_bignum_free(key->x);
	return TEE_ERROR_OUT_OF_MEMORY;
}

void AddBatchOffsets(Tensor* indices, const Tensor& params) {
  int64_t batch_size = 1;  
  for (int idx = 0; idx < batch_dims_; ++idx) {
    batch_size *= params.dim_size(idx);
  }
  auto indices_flat = indices->flat<Index>();
  int64_t const index_inner_size = indices->NumElements() / batch_size;
  int64_t const batch_offset = params.dim_size(batch_dims_);
  for (int64_t batch_idx = 0, dest_idx = 0; batch_idx < batch_size;
       ++batch_idx) {
    for (int64_t idx = 0; idx < index_inner_size; ++idx) {
      indices_flat(dest_idx++) += batch_offset * batch_idx;
    }
  }
}

int secure_check(void *data)
{
	const at91_secure_header_t *header;
	void *file;
	if (secure_decrypt(data, sizeof(*header), 0))
		return -1;
	header = (const at91_secure_header_t *)data;
	if (header->magic != AT91_SECURE_MAGIC)
		return -1;
	file = (unsigned char *)data + sizeof(*header);
	return secure_decrypt(file, header->file_size, 1);
}

get_manuf_name_if_known(const guint8 *addr)
{
    hashmanuf_t *manuf_value;
    guint manuf_key;
    guint8 oct;
    manuf_key = addr[0];
    manuf_key = manuf_key<<8;
    oct = addr[1];
    manuf_key = manuf_key | oct;
    manuf_key = manuf_key<<8;
    oct = addr[2];
    manuf_key = manuf_key | oct;
    manuf_value = (hashmanuf_t *)wmem_map_lookup(manuf_hashtable, GUINT_TO_POINTER(manuf_key));
    if (manuf_value != NULL && manuf_value->status != HASHETHER_STATUS_UNRESOLVED) {
        return manuf_value->resolved_longname;
    }
    const char *short_name, *long_name;
    short_name = ws_manuf_lookup_str(addr, &long_name);
    if (short_name != NULL) {
        return long_name;
    }
    return NULL;
}

int socket_accept(int fd, uint16_t port)
{
#ifdef WIN32
	int addr_len;
#else
	socklen_t addr_len;
#endif
	int result;
	struct sockaddr_in addr;
	memset(&addr, 0, sizeof(addr));
	addr.sin_family = AF_INET;
	addr.sin_addr.s_addr = htonl(INADDR_ANY);
