void luaD_call (lua_State *L, StkId func, int nresults) {
  lua_CFunction f;
 retry:
  switch (ttypetag(s2v(func))) {
    case LUA_VCCL:  
      f = clCvalue(s2v(func))->f;
      goto Cfunc;
    case LUA_VLCF:  
      f = fvalue(s2v(func));
     Cfunc: {
      int n;  
      CallInfo *ci = next_ci(L);
      checkstackp(L, LUA_MINSTACK, func);  
      ci->nresults = nresults;
      ci->callstatus = CIST_C;
      ci->top = L->top + LUA_MINSTACK;
      ci->func = func;
      L->ci = ci;
      lua_assert(ci->top <= L->stack_last);
      if (L->hookmask & LUA_MASKCALL) {
        int narg = cast_int(L->top - func) - 1;
        luaD_hook(L, LUA_HOOKCALL, -1, 1, narg);
      }
      lua_unlock(L);
      n = (*f)(L);  
      lua_lock(L);
      api_checknelems(L, n);
      luaD_poscall(L, ci, n);
      break;
    }
    case LUA_VLCL: {  
      CallInfo *ci = next_ci(L);
      Proto *p = clLvalue(s2v(func))->p;
      int narg = cast_int(L->top - func) - 1;  
      int nfixparams = p->numparams;
      int fsize = p->maxstacksize;  
      checkstackp(L, fsize, func);
      ci->nresults = nresults;
      ci->u.l.savedpc = p->code;  
      ci->callstatus = 0;
      ci->top = func + 1 + fsize;
      ci->func = func;
      L->ci = ci;
      for (; narg < nfixparams; narg++)
        setnilvalue(s2v(L->top++));  
      lua_assert(ci->top <= L->stack_last);
      luaV_execute(L, ci);  
      break;
    }
    default: {  
      checkstackp(L, 1, func);  
      luaD_tryfuncTM(L, func);  
      goto retry;  
    }
  }
}

void Compute(OpKernelContext* ctx) override {
  const Tensor& in0 = ctx->input(0);
  const Tensor& in1 = ctx->input(1);
  OP_REQUIRES(
      ctx, in0.NumElements() == in1.NumElements(),
      errors::InvalidArgument("The two arguments to a cwise op must have "
                              "same number of elements, got ",
                              in0.NumElements(), " and ", in1.NumElements()));
  auto in0_flat = in0.flat<Tin>();
  auto in1_flat = in1.flat<Tin>();
  const Device& eigen_device = ctx->eigen_device<Device>();
  Tensor* out = nullptr;
  if (std::is_same<Tin, Tout>::value) {
    OP_REQUIRES_OK(ctx, ctx->forward_input_or_allocate_output(
                            {0, 1}, 0, in0.shape(), &out));
  } else {
    OP_REQUIRES_OK(ctx, ctx->allocate_output(0, in0.shape(), &out));
  }
  auto out_flat = out->flat<Tout>();
  functor::SimpleBinaryFunctor<Device, Functor>()(eigen_device, out_flat,
                                                  in0_flat, in1_flat);
}

