blkxor(void * dest, void * src, size_t len)
{
  __m128i * D = (__m128i *) dest;
  __m128i * S = (__m128i *) src;
  size_t L = len / 16;
  size_t i;
  for (i = 0; i < L; i++)
    D[i] = _mm_xor_si128(D[i], S[i]);
}

