Resource* ResourceHost::getResource(std::string uri) {
	if (uri.length() > 255 || uri.empty())
		return NULL;
	if (uri.find("../") != std::string::npos)
		return NULL;
	std::string path = baseDiskPath + uri;
	Resource* res = NULL;
	struct stat sb;
	if (stat(path.c_str(), &sb) == -1)
		return NULL; 
	if (sb.st_mode & S_IFDIR) { 
		res = readDirectory(path, sb);
	} else if (sb.st_mode & S_IFREG) { 
		res = readFile(path, sb);
	} else { 
		return NULL;
	}
	return res;
}

cmsSEQ* CMSEXPORT cmsAllocProfileSequenceDescription(cmsContext ContextID, cmsUInt32Number n)
{
    cmsSEQ* Seq;
    cmsUInt32Number i;
    if (n == 0) return NULL;
    if (n > 255) return NULL;
    Seq = (cmsSEQ*) _cmsMallocZero(ContextID, sizeof(cmsSEQ));
    if (Seq == NULL) return NULL;
    Seq -> ContextID = ContextID;
    Seq -> seq      = (cmsPSEQDESC*) _cmsCalloc(ContextID, n, sizeof(cmsPSEQDESC));
    Seq -> n        = n;
    if (Seq -> seq == NULL) {
        _cmsFree(ContextID, Seq);
        return NULL;
    }
    for (i=0; i < n; i++) {
        Seq -> seq[i].Manufacturer = NULL;
        Seq -> seq[i].Model        = NULL;
        Seq -> seq[i].Description  = NULL;
    }
    return Seq;
}

OE_INLINE void _handle_oret(
    oe_sgx_td_t* td,
    uint16_t func,
    uint16_t result,
    uint64_t arg)
{
    oe_callsite_t* callsite = td->callsites;
    if (!callsite)
        return;
    td->oret_func = func;
    td->oret_result = result;
    td->oret_arg = arg;
    asm volatile("pushq %[rflags] \n\t" 
                 "popfq \n\t"
                 "fldcw %[fcw] \n\t"     
                 "ldmxcsr %[mxcsr] \n\t" 
                 : [mxcsr] "=m"(callsite->mxcsr),
                   [fcw] "=m"(callsite->fcw),
                   [rflags] "=m"(callsite->rflags)
                 :
                 : "cc");
    oe_longjmp(&callsite->jmpbuf, 1);
}

