	UriQueryListA first = { .key = "\x01", .value = "\x02", .next = &second };
	const UriBool spaceToPlus = URI_TRUE;
	const UriBool normalizeBreaks = URI_FALSE;  
	const int charsRequired = (3 + 1 + 3) + 1 + (3);
	{
		const char * const expected = "%01=%02" "&" "%11";
		char dest[charsRequired + 1];
		int charsWritten;
		TEST_ASSERT(uriComposeQueryExA(dest, &first, sizeof(dest),
				&charsWritten, spaceToPlus, normalizeBreaks)
			== URI_SUCCESS);
		TEST_ASSERT(! strcmp(dest, expected));
		TEST_ASSERT(charsWritten == strlen(expected) + 1);
	}
	{
		char dest[charsRequired + 1 - 1];
		int charsWritten;
		TEST_ASSERT(uriComposeQueryExA(dest, &first, sizeof(dest),
				&charsWritten, spaceToPlus, normalizeBreaks)
			== URI_ERROR_OUTPUT_TOO_LARGE);
	}
}

static int decode_server_caps(struct xdr_stream *xdr, struct nfs4_server_caps_res *res)
{
	unsigned int savep;
	uint32_t attrlen, bitmap[3] = {0};
	int status;
	if ((status = decode_op_hdr(xdr, OP_GETATTR)) != 0)
		goto xdr_error;
	if ((status = decode_attr_bitmap(xdr, bitmap)) != 0)
		goto xdr_error;
	if ((status = decode_attr_length(xdr, &attrlen, &savep)) != 0)
		goto xdr_error;
	if ((status = decode_attr_supported(xdr, bitmap, res->attr_bitmask)) != 0)
		goto xdr_error;
	if ((status = decode_attr_fh_expire_type(xdr, bitmap,
						 &res->fh_expire_type)) != 0)
		goto xdr_error;
	if ((status = decode_attr_link_support(xdr, bitmap, &res->has_links)) != 0)
		goto xdr_error;
	if ((status = decode_attr_symlink_support(xdr, bitmap, &res->has_symlinks)) != 0)
		goto xdr_error;
	if ((status = decode_attr_aclsupport(xdr, bitmap, &res->acl_bitmask)) != 0)
		goto xdr_error;
	status = verify_attr_len(xdr, savep, attrlen);
xdr_error:
	dprintk("%s: xdr returned %d!\n", __func__, -status);
	return status;
}

kvp_respond_to_host(char *key, char *value, int error)
{
	struct hv_kvp_msg  *kvp_msg;
	struct hv_kvp_msg_enumerate  *kvp_data;
	char	*key_name;
	struct icmsg_hdr *icmsghdrp;
	int	keylen, valuelen;
	u32	buf_len;
	struct vmbus_channel *channel;
	u64	req_id;
	if (!kvp_transaction.active) {
		pr_warn("KVP: Transaction not active\n");
		return;
	}
	buf_len = kvp_transaction.recv_len;
	channel = kvp_transaction.recv_channel;
	req_id = kvp_transaction.recv_req_id;
	kvp_transaction.active = false;
	if (channel->onchannel_callback == NULL)
		return;
	icmsghdrp = (struct icmsg_hdr *)
			&recv_buffer[sizeof(struct vmbuspipe_hdr)];
	kvp_msg = (struct hv_kvp_msg *)
			&recv_buffer[sizeof(struct vmbuspipe_hdr) +
			sizeof(struct icmsg_hdr)];
	kvp_data = &kvp_msg->kvp_data;
	key_name = key;
	if (error) {
		icmsghdrp->status = HV_E_FAIL;
		goto response_done;
	}
	keylen = utf8s_to_utf16s(key_name, strlen(key_name),
				(wchar_t *)kvp_data->data.key);
	kvp_data->data.key_size = 2*(keylen + 1); 
	valuelen = utf8s_to_utf16s(value, strlen(value),
				(wchar_t *)kvp_data->data.value);
	kvp_data->data.value_size = 2*(valuelen + 1); 
	kvp_data->data.value_type = REG_SZ; 
	icmsghdrp->status = HV_S_OK;
response_done:
	icmsghdrp->icflags = ICMSGHDRFLAG_TRANSACTION | ICMSGHDRFLAG_RESPONSE;
	vmbus_sendpacket(channel, recv_buffer, buf_len, req_id,
				VM_PKT_DATA_INBAND, 0);
}

