    const struct lys_node *schema = NULL, *snode;
    if (!module || !name_template || !name) {
        LOGARG;
        return NULL;
    }
    schema = lyp_get_yang_data_template(module, name_template, strlen(name_template));
    if (!schema) {
        LOGERR(module->ctx, LY_EINVAL, "Failed to find yang-data template \"%s\".", name_template);
        return NULL;
    }
    if (lys_getnext_data(module, schema, name, strlen(name), LYS_CONTAINER, &snode) || !snode) {
        LOGERR(module->ctx, LY_EINVAL, "Failed to find \"%s\" as a container child of \"%s:%s\".",
               name, module->name, schema->name);
        return NULL;
    }
    return _lyd_new(NULL, snode, 0);
}

static ::tensorflow::Status ValidateInputs(
    std::vector<ConstFlatSplits> rt_nested_splits,
    const Tensor& rt_dense_values_in) {
  for (int i = 0; i < rt_nested_splits.size(); ++i) {
    if (rt_nested_splits[i].size() == 0) {
      return InvalidArgument("ragged splits may not be empty.");
    }
    if (rt_nested_splits[i](0) != 0) {
      return InvalidArgument("First value of ragged splits must be 0.");
    }
    for (int j = 1; j < rt_nested_splits[i].size(); ++j) {
      if (rt_nested_splits[i](j) < rt_nested_splits[i](j - 1)) {
        return InvalidArgument(
            "Ragged splits should be non decreasing, but we got ",
            rt_nested_splits[i](j - 1), " followed by ",
            rt_nested_splits[i](j));
      }
    }
    if (i > 0) {
      SPLITS_TYPE last_split =
          rt_nested_splits[i - 1](rt_nested_splits[i - 1].size() - 1);
      if (rt_nested_splits[i].size() != last_split + 1) {
        return InvalidArgument(
            "Final value of ragged splits must match the length "
            "the corresponding ragged values.");
      }
    }
  }
  if (rt_dense_values_in.dim_size(0) !=
      rt_nested_splits.back()(rt_nested_splits.back().size() - 1)) {
    return InvalidArgument(
        "Final value of ragged splits must match the length "
        "the corresponding ragged values.");
  }
  return ::tensorflow::Status::OK();
}

compute_O_value(std::string const& user_password,
		std::string const& owner_password,
		QPDF::EncryptionData const& data)
{
    unsigned char O_key[OU_key_bytes_V4];
    compute_O_rc4_key(user_password, owner_password, data, O_key);
    char upass[key_bytes];
    pad_or_truncate_password_V4(user_password, upass);
    std::string k1(reinterpret_cast<char*>(O_key), OU_key_bytes_V4);
    pad_short_parameter(k1, data.getLengthBytes());
    iterate_rc4(QUtil::unsigned_char_pointer(upass), key_bytes,
		O_key, data.getLengthBytes(),
                (data.getR() >= 3) ? 20 : 1, false);
    return std::string(upass, key_bytes);
}

krb5_pac_parse(krb5_context context,
               const void *ptr,
               size_t len,
               krb5_pac *ppac)
{
    krb5_error_code ret;
    size_t i;
    const unsigned char *p = (const unsigned char *)ptr;
    krb5_pac pac;
    size_t header_len;
    krb5_ui_4 cbuffers, version;
    *ppac = NULL;
    if (len < PACTYPE_LENGTH)
        return ERANGE;
    cbuffers = load_32_le(p);
    p += 4;
    version = load_32_le(p);
    p += 4;
    if (version != 0)
        return EINVAL;
    header_len = PACTYPE_LENGTH + (cbuffers * PAC_INFO_BUFFER_LENGTH);
    if (len < header_len)
        return ERANGE;
    ret = krb5_pac_init(context, &pac);
    if (ret != 0)
        return ret;
    pac->pac = (PACTYPE *)realloc(pac->pac,
                                  sizeof(PACTYPE) + ((cbuffers - 1) * sizeof(PAC_INFO_BUFFER)));
    if (pac->pac == NULL) {
        krb5_pac_free(context, pac);
        return ENOMEM;
    }
    pac->pac->cBuffers = cbuffers;
    pac->pac->Version = version;
    for (i = 0; i < pac->pac->cBuffers; i++) {
        PAC_INFO_BUFFER *buffer = &pac->pac->Buffers[i];
        buffer->ulType = load_32_le(p);
        p += 4;
        buffer->cbBufferSize = load_32_le(p);
        p += 4;
        buffer->Offset = load_64_le(p);
        p += 8;
        if (buffer->Offset % PAC_ALIGNMENT) {
            krb5_pac_free(context, pac);
            return EINVAL;
        }
        if (buffer->Offset < header_len ||
            buffer->Offset + buffer->cbBufferSize > len) {
            krb5_pac_free(context, pac);
            return ERANGE;
        }
    }
    pac->data.data = realloc(pac->data.data, len);
    if (pac->data.data == NULL) {
        krb5_pac_free(context, pac);
        return ENOMEM;
    }
    memcpy(pac->data.data, ptr, len);
    pac->data.length = len;
    *ppac = pac;
    return 0;
}

