static void *smm_stub_place_stacks(char *base, size_t size,
				   struct smm_loader_params *params)
{
	size_t total_stack_size;
	char *stacks_top;
	total_stack_size = params->per_cpu_stack_size *
			   params->num_concurrent_stacks;
	printk(BIOS_DEBUG, "%s: cpus: %zx : stack space: needed -> %zx\n",
		__func__, params->num_concurrent_stacks,
		total_stack_size);
	printk(BIOS_DEBUG, "  available -> %zx : per_cpu_stack_size : %zx\n",
		size, params->per_cpu_stack_size);
	if (params->num_concurrent_stacks < 1)
		return NULL;
	if (total_stack_size > size)
		return NULL;
	stacks_top = &base[total_stack_size];
	printk(BIOS_DEBUG, "%s: exit, stack_top %p\n", __func__, stacks_top);
	return stacks_top;
}

sds *ldbReplParseCommand(int *argcp) {
    sds *argv = NULL;
    int argc = 0;
    if (sdslen(ldb.cbuf) == 0) return NULL;
    sds copy = sdsdup(ldb.cbuf);
    char *p = copy;
    p = strchr(p,'*'); if (!p) goto protoerr;
    char *plen = p+1; 
    p = strstr(p,"\r\n"); if (!p) goto protoerr;
    *p = '\0'; p += 2;
    *argcp = atoi(plen);
    if (*argcp <= 0 || *argcp > 1024) goto protoerr;
    argv = zmalloc(sizeof(sds)*(*argcp));
    argc = 0;
    while(argc < *argcp) {
        if (*p != '$') goto protoerr;
        plen = p+1; 
        p = strstr(p,"\r\n"); if (!p) goto protoerr;
        *p = '\0'; p += 2;
        int slen = atoi(plen); 
        if (slen <= 0 || slen > 1024) goto protoerr;
        argv[argc++] = sdsnewlen(p,slen);
        p += slen; 
        if (p[0] != '\r' || p[1] != '\n') goto protoerr;
        p += 2; 
    }
    sdsfree(copy);
    return argv;
protoerr:
    sdsfreesplitres(argv,argc);
    sdsfree(copy);
    return NULL;
}

pci_vtrnd_notify(void *vsc, struct vqueue_info *vq)
{
	struct iovec iov;
	struct pci_vtrnd_softc *sc;
	int len;
	uint16_t idx;
	sc = vsc;
	if (sc->vrsc_fd < 0) {
		vq_endchains(vq, 0);
		return;
	}
	while (vq_has_descs(vq)) {
		vq_getchain(vq, &idx, &iov, 1, NULL);
		len = (int) read(sc->vrsc_fd, iov.iov_base, iov.iov_len);
		DPRINTF(("vtrnd: vtrnd_notify(): %d\r\n", len));
		assert(len > 0);
		vq_relchain(vq, idx, (uint32_t)len);
	}
	vq_endchains(vq, 1);	
}

