public char * shell_quoten(constant char *s, size_t slen)
{
	constant char *p;
	char *np;
	char *newstr;
	size_t len;
	constant char *esc = get_meta_escape();
	size_t esclen = strlen(esc);
	lbool use_quotes = FALSE;
	lbool have_quotes = FALSE;
	len = 1; 
	for (p = s;  p < s + slen;  p++)
	{
		len++;
		if (*p == openquote || *p == closequote)
			have_quotes = TRUE;
		if (metachar(*p))
		{
			if (esclen == 0)
			{
				use_quotes = TRUE;
			} else
			{
				len += esclen;
			}
		}
	}
	if (use_quotes)
	{
		if (have_quotes)
			return (NULL);
		len = slen + 3;
	}
	newstr = np = (char *) ecalloc(len, sizeof(char));
	if (use_quotes)
	{
		SNPRINTF4(newstr, len, "%c%.*s%c", openquote, (int) slen, s, closequote);
	} else
	{
		constant char *es = s + slen;
		while (s < es)
		{
			if (metachar(*s))
			{
				strcpy(np, esc);
				np += esclen;
			}
			*np++ = *s++;
		}
		*np = '\0';
	}
	return (newstr);
}

acl_fetch_stver(struct proxy *px, struct session *l4, void *l7, int dir,
                struct acl_expr *expr, struct acl_test *test)
{
	struct http_txn *txn = l7;
	char *ptr;
	int len;
	if (!txn)
		return 0;
	if (txn->rsp.msg_state < HTTP_MSG_BODY)
