kick_delayed_job(tube t)
{
    int r;
    job j;
    size_t z;
    j = pq_take(&t->delay);
    if (!j) return 0;
    z = binlog_reserve_space_update(j);
    if (!z) return pq_give(&t->delay, j), 0; 
    j->reserved_binlog_space += z;
    j->kick_ct++;
    r = enqueue_job(j, 0, 1);
    if (r == 1) return 1;
    r = enqueue_job(j, j->delay, 0);
    if (r == 1) return 0;
    bury_job(j, 0);
    return 0;
}

mrb_singleton_class_ptr(mrb_state *mrb, mrb_value v)
{
  struct RBasic *obj;
  switch (mrb_type(v)) {
  case MRB_TT_FALSE:
    if (mrb_nil_p(v))
      return mrb->nil_class;
    return mrb->false_class;
  case MRB_TT_TRUE:
    return mrb->true_class;
  case MRB_TT_CPTR:
  case MRB_TT_SYMBOL:
  case MRB_TT_INTEGER:
#ifndef MRB_NO_FLOAT
  case MRB_TT_FLOAT:
#endif
    return NULL;
  default:
    break;
  }
  obj = mrb_basic_ptr(v);
  if (obj->c == NULL) return NULL;
  prepare_singleton_class(mrb, obj);
  return obj->c;
}

