  OP_REQUIRES_OK(c, TensorShapeFromTensor(c->input(0), &element_shape));
  OP_REQUIRES(
      c, TensorShapeUtils::IsScalar(c->input(1).shape()),
      errors::InvalidArgument(
          "The num_elements to reserve must be a tensor size 1, but got ",
          c->input(1).shape()));
